    //     <div className="copyRight">
    //       <div className="footer-top">
    //         <i className="fa-copyright"></i>
    //         <span>Copyright 2020, OAI</span>
    //       </div>
    //       <div className="socialMedia">
    //           <span className="each-icon">Follow Us </span>
    //           <span className="each-icon">@FB</span>
    //           <span className="each-icon">@TW</span>
    //           <span className="each-icon">@IG</span>
    //       </div>
    //     </div>
    //   </footer>
    // </div>
    <div onload={onScreenLoad}>
    <div className="header-bar" >
    <header>
      <div className="logo">Logo</div>
      <div className="hd-col">
        <Link to="/" className="hd">HOME</Link>

        <Link to="/about/" className="hd">ABOUT</Link>

        <Link to="/contactus/" className="hd">CONTACT US</Link>

        <Link to="/APPLICATIONS/" className="hd">APPLICATIONS</Link>

        <Link to="/signin/" className="hd">SIGNIN</Link>

      </div>
      <div className="hamburg" onClick={menuNavBar}>
        MENU
      </div>
    </header>

      <div className="menu" id="menu">
        <div className="navbar" id="navbar">
          <hr />
          <Link to="/" className="hdm home">HOME</Link>
          <hr />

          <Link to="/aboutus" className="hdm">
            ABOUT
          </Link>
          <hr />

          <Link to="/contactus" className="hdm">CONTACT US</Link>
          <hr />

          <Link to="/APPLICATIONS" className="hdm">APPLICATIONS</Link>
          <hr />
          <Link to="/signin" className="hdm">SIGNIN</Link>
          <hr />
        </div>
      </div>

  </div>
  </div>
  );
}
export default Footer;
